import React, { useEffect, useState, useContext } from 'react';
import { AuthContext } from '../AuthContext';

function PageManagement({ config }) {
  const { token, user } = useContext(AuthContext);
  const [items, setItems] = useState([]);
  const [formData, setFormData] = useState({});
  const [editingId, setEditingId] = useState(null);

  const can = (perm) => user.permissions?.includes(config.permissions?.[perm]);

  const fetchData = async () => {
    if (!can('view')) return;
    const res = await fetch(config.api.list, {
      headers: { Authorization: `Bearer ${token}` }
    });
    const data = await res.json();
    setItems(data);
  };

  useEffect(() => { fetchData(); }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (editingId && !can('edit')) return alert('Không có quyền sửa');
    if (!editingId && !can('add')) return alert('Không có quyền thêm');

    const method = editingId ? 'PUT' : 'POST';
    const url = editingId
      ? config.api.update.replace(':id', editingId)
      : config.api.create;

    const res = await fetch(url, {
      method,
      headers: {
        'Content-Type': 'application/json',
        Authorization: `Bearer ${token}`
      },
      body: JSON.stringify(formData)
    });

    if (res.ok) {
      fetchData();
      setFormData({});
      setEditingId(null);
    } else {
      alert('Lỗi khi gửi dữ liệu');
    }
  };

  const handleDelete = async (id) => {
    if (!can('delete')) return alert('Không có quyền xoá');
    const res = await fetch(config.api.delete.replace(':id', id), {
      method: 'DELETE',
      headers: { Authorization: `Bearer ${token}` }
    });
    if (res.ok) fetchData();
    else alert('Xoá thất bại');
  };

  return (
    <div>
      <h2>{config.title}</h2>

      {can('view') && (
        <table border="1" cellPadding="8">
          <thead>
            <tr>
              {config.fields.map(f => <th key={f.name}>{f.label}</th>)}
              <th>Hành động</th>
            </tr>
          </thead>
          <tbody>
            {items.map(i => (
              <tr key={i.id}>
                {config.fields.map(f => <td key={f.name}>{i[f.name]}</td>)}
                <td>
                  {can('edit') && <button onClick={() => {
                    setFormData(i);
                    setEditingId(i.id);
                  }}>Sửa</button>}
                  {' '}
                  {can('delete') && <button onClick={() => handleDelete(i.id)}>Xoá</button>}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      <hr />
      <h3>{editingId ? 'Chỉnh sửa' : 'Thêm mới'}</h3>
      <form onSubmit={handleSubmit}>
        {config.fields.map(f => (
          <div key={f.name}>
            <label>{f.label}</label><br />
            <input
              type={f.type}
              value={formData[f.name] || ''}
              onChange={e => setFormData({ ...formData, [f.name]: e.target.value })}
            />
          </div>
        ))}
        <button type="submit">{editingId ? 'Cập nhật' : 'Tạo mới'}</button>
      </form>
    </div>
  );
}

export default PageManagement;
